import React from "react";
import "./style.css"



function Todo ({todoList,}) {
    console.log(todoList)

    return(

        <>
        {
        todoList.map(each=>{
        <div className="Todo-box">
        <h2>{each.titleValue}</h2>
        <p>{each.contentValue}</p>
        <button>시작하기</button>
        <button>완료</button>
        </div>

        })
        }
        </>

    );
}

export default Todo;
